import React from 'react'
import AChart from "react-apexcharts";

const Seeds= ({todos, options}) =>{
    const todoList = todos.length ? (
        todos.map( (todo, index) => {
            let option = 'chart-'.concat(index);
            let name= todo.name;
            Object.assign(options, {chart: {...options.chart,id:option}});
            Object.assign(options, {title: {...options.title,text:name}});
            console.log(option);
            console.log(name);
            console.log(options);
            return(
                /*<div className="col s6" key={index}>
                    <div className="card">
                        <AChart
                        options={option}
                        series={[todo]}/>
                    </div>
                </div>*/option
            );
        }
        )
    ) : (
        <p className="center">Loading</p>
    );
    return(
        <div className="container">
            <div className="row">
                {todoList}
            </div>
        </div>
    );
}
export default Seeds;
